drop table if exists character_base_stats;

create table character_base_stats (
	id int unsigned not null auto_increment,
	race tinyint unsigned not null,
	class tinyint unsigned not null,
	level tinyint unsigned not null,
	health int unsigned not null,
	mana int unsigned not null default 0,
	strength int unsigned not null,
	agility int unsigned not null,
	stamina int unsigned not null,
	intellect int unsigned not null,
	spirit int unsigned not null,
	
	primary key (id),
	unique key idx_race_class_level (race, class, level),
	
	foreign key (race) references race_definition (id)
);

